@wildlyartistic Hello Daniel,
Our website is currently experiencing some issues, a situation for which we apologize. Our IT team is looking into this and it will be resolved as promptly as possible. In the meantime, we suggest that you try to login through an incognito window.
(1/2)

@Noisette_uh Bonjour Imene,
nous avons répondu à votre message privé.
Merci.

@jgeremia Hello Julie,
In order to verify, we kindly ask you to indicate us your ticket number starting with 047- followed by 10 digits.
Thank you.

@inespautasso Olá Inês,
para que possamos verificar a situação, pedimos que nos indique o seu código de reserva e nos envie um print screen do erro registado.
Para salvaguardar a confidencialidade dos seus dados, sugerimos o envio dos mesmos através de mensagem privada. Obrigada.

@BhaaratVerma1 Hello Bhaarat,
first of all, please accept our sincere apologies for the waiting.
We will reply to your private message as soon as possible. We thank you for your understanding.

@Faridashuaib_ @ofthefinerwords In what concerns travel restrictions and entry requirements, you can verify all the information through the following link: https://t.co/vsG5iqK1AR
We remain available for any other questions.
Thank you. (2/2)

@AlarconEmmanue1 (2/2)
Pour des raisons de sécurité, nous vous suggérons de l'envoyer par message privé.
Merci.

@AlarconEmmanue1 Bonsoir Alarcon, 
Nous vous présentons nos plus sincères excuses pour les désagréments occasionnés. Afin que nous puissions vous aider à travers ce canal, nous vous prions de bien vouloir nous fournir la référence du dossier de réclamation des bagages perdus. 
(1/2)

@HarshilRulez Hello ☠ Danger-Zone :'D ☠,
You can insert the passport details that you have now and when you have a new passport, you can update them either through our website or by sending us a private message with your booking reference and new passport details.  
Thank you. 😉✈️

@LaidBackLeeD Hello Lee,
We have answered your private message and remain available to assist you.
Thank you.

@hy6j2xfppp Hello Iwona,
May you please send us a private message in English?
Thank you.

@AngelaHDale @martindale_kari Hello Angela,
in order to verify the situation, please provide us with the booking reference/ticket number and e-mail address associated. For confidentiality reasons, we suggest you to send the details by private message.
Thank you.

@valentinaamg_ Hola Valentina,
para verificar la situación, le pedimos que nos indique el número de su caso y la dirección de correo electrónico asociada.
Para salvaguardar la confidencialidad de sus datos, le sugerimos que los envíe por mensaje privado. Gracias.

@mtc223 Hola Maria,
hemos respondido a su mensaje privado.
Gracias.

@pacosepulcre Hola paco,
una vez más, acepte nuestras más sinceras disculpas por la espera.
Su reclamación ha sido presentada el 13 de septiembre de 2022 y, como ya informado, aún está bajo análisis. Será contactado por correo electrónico lo más breve posible. (1/2)
